// InitModule
// change_viewport();


function InitModule()
{
	$(document).ready(function() {
		change_viewport();
	});
	

	$("body").on("click", ".js-next, .js-prev, .lmm-header-icon-menu, .lmm-menu__nav-link, .lmm-menu__nav-sublink", function(){
	    setTimeout(function() { 
	        progressBar();  
	    }, 100)
	});

	$(window).resize(function() {
      change_viewport();
    });
	function change_viewport() {
		if (window.screen.width > 720) {
			$("meta[name = viewport]").attr("content", "width=1000, maximum-scale=1, user-scalable=1");

		} else {
			$("meta[name = viewport]").attr("content", "width=device-width");
		}
	}

	// $(document).on('click', '.baron', function () {
	// 	var body = document.documentElement;
	// 	if (body.requestFullscreen) {
	// 	  body.requestFullscreen();
	// 	} else if (body.webkitrequestFullscreen) {
	// 	  body.webkitrequestFullscreen();
	// 	} else if (body.mozrequestFullscreen) {
	// 	  body.mozrequestFullscreen();
	// 	} else if (body.msrequestFullscreen) {
	// 	  body.msrequestFullscreen();
	// 	}
	// });

	$(document).on('click', '.lmm-tabs__link', function () {
	  if ($(window).width() > 719) {
	    return;
	  }

	  var linksCollection = $(this).closest('.lmm-tabs').find(".lmm-tabs__link");

	  linksCollection.each(function () {
	    $(this).removeClass("current");
	    $($(this).attr("data-href")).hide();
	  });


	  $(this).addClass("current");
	  $($(this).attr("data-href")).show();
	});

	$("body").on("click mousedown touch", ".js-next", function () {
        $('#next img').click();
        progressBar();
        modulNames();
    });
    $("body").on("click mousedown touch", ".js-prev", function () {
        $('#prev img').click();
        progressBar();
        modulNames();
    });

	$("body").on("click mousedown touch", ".lmm-icon__menu", function () {
	    EventBus.$emit('open-menu');
	});
	$("body").on("click mousedown touch", ".lmm-menu__header-close", function () {
	    EventBus.$emit('close-menu');
	});
	
	$("body").on("click", ".lmm-accordion .lmm-accordion__item",function () {
	  if( $(this).hasClass('sel') )
	  {
	    $(this).toggleClass("sel");
	    $(this).parent().find('.lmm-accordion__acc-cont').slideToggle(300);
	  }
	  else
	  {
	    var index_acc_sel = $('.lmm-accordion__item.sel:visible').index();
	    var index_acc = $(this).parent().index('.lmm-accordion__item');
	    var accContentHeight = $('.lmm-accordion__item.sel:visible .lmm-accordion__acc-cont').height();
	      
	    $('.lmm-accordion__acc-cont').slideUp(300);
	    $('.lmm-accordion__item').removeClass('sel');
	    $(this).addClass("sel");
	    $(this).parent().find('.lmm-accordion__acc-cont').slideDown(300);
	  }
	}); 

	$("body").on("click", ".lmm-bookmarks__tabs", function () {
	  $('.lmm-bookmarks__tabs.sel').removeClass('sel');
	  $(this).addClass('sel');
	  $('.lmm-bookmarks:visible .lmm-bookmarks__content').hide();
	  $('.lmm-bookmarks:visible .lmm-bookmarks__content').eq($(this).index()).show();
	});

}

// ShutdownModule
function ShutdownModule()
{

}



function gotoFrame(sFrameId, event) {
    if (sFrameId != "") {
        var jxFrame = CL.axSlides.find("frame[id='" + sFrameId + "']");
        var jxSlide = jxFrame.parents("slide:first");
        sSlideId = jxSlide.attr("id");
        if (jxSlide.attr("id") != CLZ.sCurrentSlideId) {
            CL.Open.Slide({
                slideid: sSlideId
            });
            if (!CLF[sFrameId].bIsFirst) {
                CLF[sFrameId].Start();
            }
        } else {
            CLF[sFrameId].Start();
        }
    }
}

function contents() {
	$('.lmm-menu__content .lmm-menu__nav-item.active').removeClass('active');
	current = $('#contents_old .slide-item.current').index();
	$('.lmm-menu__content .lmm-menu__nav-item').eq(current).addClass('active');

	$('#contents_old_default .unvisited').removeClass('allowed').addClass('forbidden').off();


	$('#contents_old .slide-item').filter(function(){
		if( ($(this).hasClass('visited') || $(this).hasClass('current')) && !($(this).next().hasClass('forbidden')) && !($(this).hasClass('next_open')) && ($(this).index() != $('#contents_old .slide-item').length-1) ) 
		{
			$(this).addClass('next_open');
		}
	})	
}

function Names() {
	var FirstName = $('.lmm-input__start').val();
	CLJ.FirstName.nRawScore = FirstName;
}

function progressBar(){

 	var current_frame = $(".cl-scale.cl-scale-var").width();
    var total_frame = $(".cl-bar.cl-bar-var").width();
    $('span.FirstName').html(CLJ.FirstName.nRawScore);
  
    $(".lmm-progress").css({
        "width": total_frame/current_frame*100 + '%'
    });
    modulNames();
}



