var getAccountMail = function (tcud) {
	if (typeof tcud !== 'object') {
		return '';
	}

	if (!tcud.hasOwnProperty('actor')) {
		return '';
	}

	try {
		return tcud.actor.account.name.split('|')[1];
	} catch (err) {
		return tcud.actor.name;
	}
}

