function setTabs() {
  $('.lmm-tabs').each(function () {
    if ($(this).width() <= 719) {
      $(this).find(".lmm-tabs__item").hide();
      var linksCollection = $(this).find(".lmm-tabs__link");
      $(linksCollection.removeClass("current").first().addClass("current").attr("data-href")).show();
    } else {
      $(this).find(".lmm-tabs__link").removeClass("current");
      $(this).find(".lmm-tabs__item").show();
    }
  })
}

