function slider() {
   setTimeout(function() { 
       $('.lmm-slider').slick({
         dots: true,
         speed: 300,
         slidesToShow: 1,
         slidesToScroll: 1,
         infinite: false,
         edgeFriction: 0,
         adaptiveHeight: true,
       });  

       var current_article = $('.lmm-slider').slick('slickCurrentSlide');
       var total_articles = $('.lmm-slider').slideCount;
       $('.lmm-slider').on('init reInit afterChange', function(event, slick, currentSlide, nextSlide){
           current_article = $('.lmm-slider').slick('slickCurrentSlide');
           total_articles = slick.slideCount;
           slickArrow();
       });
       slickArrow();
       function slickArrow() {  
           if(current_article==0){
              $('.slick-prev').fadeOut();
           }else{
              $('.slick-prev').fadeIn();
           }
           if (current_article==total_articles-1){
               $('.slick-next').fadeOut();
           }else{
               $('.slick-next').fadeIn();
           }
       }

       if ('ontouchstart' in document) {
           this.$('.slick-dots').addClass('touch-device');
       }

       $('.lmm-slider__item.slick-slide:visible').eq(0).addClass('customClass');

       $('.lmm-slider').on('beforeChange', function(event, slick, currentSlide, nextSlide){
       	$(this).find('.slick-slide[data-slick-index="'+nextSlide+'"]').addClass('customClass');
       	 	if($('.slick-dots li:visible').length == $('.lmm-slider__item.slick-slide.customClass:visible').length){
        		$('.lmm-visibility__hidden').eq(0).removeClass('lmm-visibility__hidden');
        	}
       });
   }, 200)
}

